Content:
If you transfer a million dollars from bank A to an account in bank B, then the following will happen:<p>1) Bank A will decrement your [fake] balance;
2) Bank B will increment that account's balance;
3) Bank A will note that they owe 1 million to bank B, and Bank B will not that they deserve 1 million from bank A. They'll settle that balance somehow (that's a bit complex and irrelevant), but the debt now exists. If they don't trust each other that much, then bank B will credit the funds only after bank A has paid them; this often causes a couple days delay in international bank transfers.<p>Do you now see how they can't "create money" by whatever they do in their databases? To give cash out, banks need cash; to send money somewhere else, they need to give money to that somewhere else or convince that 'somewhere else' to lend them that money.<p>In essence, altering an account balance is exactly equivalent to faking a document stating "Bank owes me X dollars" so well that the bank (temporarily) believes it - nothing more.
